import React from 'react';
import { SectionsContainer, Section } from 'react-fullpage';
import "../Style/LayOut.css";
import { Container1,Container1Inner,Container2 } from '../StyleComponents/StyleComponent';
function Layout(props) {

    let options = {
        anchors: ['sectionOne', 'sectionTwo', 'sectionThree'],
        navigation: false,
        // delay: 1000,
    };


    return (
        <SectionsContainer {...options}>
            <Section>
                <Container1>
                    <Container1Inner>

                    </Container1Inner>
                </Container1>
            </Section>

            <Section>
                <Container2>
                <span>섹션2</span>
                </Container2>
            </Section>

            <Section>
                Page 3
            </Section>
        </SectionsContainer>
    );
}

export default Layout;
